import React from "react";
import CategoryItem from "./CategoryItem";

const CategoryList = () => {
  return (
    <>
      <div className="App">
        <div className="d-flex p-3 justify-content-center secordory-color">
          <h1>Category</h1>
          <CategoryItem />
          <CategoryItem />
          <CategoryItem />
        </div>
      </div>
    </>
  );
};

export default CategoryList;
